import React from "react";

function TopButtons() {
  const cities = [
    {
      id: 1,
      title: "London",
    },
    {
      id: 2,
      title: "Sydney",
    },
    {
      id: 3,
      title: "New York",
    },
    {
      id: 4,
      title: "Auckland",
    },
    {
      id: 5,
      title: "Tokyo",
    },
  ];
  return <div>Top Buttons</div>;
}

export default TopButtons;
